INSERT INTO `topics` VALUES (1, 'go-sql-driver/mysql', 'year 0 in time.Time is valid but always throws an error', 'After upgrade from v1.5.0 to v.1.6.0, a time.Time representing an actual time without a date cannot be inserted into a column of type TIME any longer, as it has year 0 set. funnily, this value was previously even retrieved from the DB. year 0 is also in general not an invalid time.Time value for real dates. The following recently added line throws an error when the year is 0. As far as i can see, appendDateTime(), the function which contains this line, is called twice, and both times when the given time.Time does not have its zero value as determined by IsZero(). however, the zero value for a time. Time is in year 1. What is the reason the range was picked to be [1, 9999] here? If you can confirm this is actually an issue, i\'m willing to try and fix it. The error i receive is the error from the line i specified above. ', 24);
INSERT INTO `topics` VALUES (2, 'go-sql-driver/mysql', 'ExecContext should return error if it is canceled during execution', 'mysqlConn.ExecContext uses mysqlConn.watchCancel to decide if the ctx passed as an argument is canceled, so if the ctx is canceled before the decision, it returns an error. However, mysqlConn.ExecContext does not return an error even if the ctx is cancelled during or after mysqlConn.Exec execution, or during mysqlConn.finish execution in defer. Is this the intended behavior?', 21);
INSERT INTO `topics` VALUES (3, 'go-sql-driver/mysql', 'Add XAPI support', 'Any interest in adding xapi support to your Go driver to support the new protocol and APIs that we have introduced with 5.7? If so please reach out to me as we would love to help.', 19);
INSERT INTO `topics` VALUES (8, 'go-sql-driver/mysql', 'Read tcp connection timed out', 'I am currently experiencing a stalling or broken web app after a period of idle between 15 to 48 minutes. The most critical issue is described below: Visit a URL, any url on the site, and load the page completely (as in, the page actually loads and the logs show a complete page has loaded). Close browser, and wait. After a long period of time (ranging from 15m to 48m), the system all of a sudden logs these lines below with no interaction - the web app has been idle this entire time. Notice the \"TOTAL TIME\" is 31 minutes and 19 seconds? Also, notice the MySql driver error that is logged at the same time? There was no activity / no web request made. The web app was simply idle. The most critical issue is what comes next after these log messages: _the very next web request is stalls completely, never returning a response_: And it sits idle, no response, for 15 minutes until wget times out. Now, if I make a 2nd or 3rd request immediately after this one is stalled and anytime while it is stalled, the go web app responds and returns a full page for other requests. No issues. And then, the cycle starts over from the last request I make and let it site idle. After this 15m, you can guess exactly what is logged next. I eliminated Windows Azure, the Cluster VIP and Firewall/Linux VM running the go web app as an issue because I ran wget http://localhost locally on the same box, and I get this \"stalled\" request that never completes and never sends back anything. Do note that the Linux box running MySql is a different Linux box running the cluster of GoLang apps - and they are in separate dedicated Cloud Services. The MySql vm is a single VM, no cluserting. In addition to this query, my \"Context\" you see being passed into the handler runs 4 to 6 additional SQL queries. Therefore, each \"article\" handler that loads runs about 5 to 7 SQL queries, minimal, using the exact same pattern and *db global variable you see above. Timeouts / errors are always on the same DB query. I do call defer rows2.Close() only if there was no error. Perhaps that is part of the issue? This particular SQL query seems to log errors under load tests as no response or mysql driver timing out. Why am I getting request timeouts logged in excess of 15 to 30 minutes, from an idle site? That seems like a bug with the mysql driver I am using, possibly holding a connection open. But, the last http request was successful and returned a complete page + template. I even have the Timeout set in the connection string, which is 5 seconds. Even if it is a problem with the mysql server, why the 15 minute timeout/request logged? Where did that request come from? It still could be a MySql driver issue, blocking the request from completing - maybe being blocked by the MySql dedicated VM and an issue there. If that is the case, then how come nothing is logged? What is this random timeout of 15m to 49m minutes? It is usually only 15m or 31m, but sometimes 48m is logged.It is very interesting on the \"15m\" multiples there in the timeouts (@15m, 31m and 48m), allotting for some padding there in seconds. ', 58);
INSERT INTO `topics` VALUES (9, 'go-sql-driver/mysql', 'Implement Context Interface ', 'I am interested in adding golang.org/x/net/context to the standard library, probably as the top-level package context. (Why not net/context? It has little to do with networking, except that people often use it with networking; it doesn\'t even cross network boundaries on its own without help.) Do we do something with the io package in the same release, or later? i.e. do we add *os.File.IO(context.Context) io.ReadWriteCloser sort of methods, to curry a context into io interfaces? Or wait on that. If it\'d be nice to push down cancelation into even OS-level file I/O, but we don\'t even really do that inside Google with IO-like methods and pervasive Context usage, since we don\'t really use *os.File. So I\'m inclined to wait on that. Too many operating systems to deal with. We can\'t add it to as many places in the standard library we\'d like to since APIs are frozen. Basically we can only add it to structs. While we\'ve told people not to add contexts to structs, I think that guidance is over-aggressive. The real advice is not to store contexts. They should be passed along like parameters. But if the struct is essentially just a parameter, it\'s okay. I think this concern can be addressed with package-level documentation and examples. What field name in structs to use? We use \"ctx\" for variables, but struct names are typically spelled out. But does that cause too much stutter?', 57);
INSERT INTO `topics` VALUES (10, 'go-sql-driver/mysql', 'Still can\'t authenticate with allowOldPasswords=1', 'We\'re running Go 1.1.1, MySQL 5.0.22 on a separate server (but the database is legacy and MySQL itself has been upgraded a few times, I\'m sure it was 4.x at some point.) and \"old_passwords\" is set to ON. (verified with SHOW VARIABLES.) I\'m converting a batch of Perl and Ruby scripts to Go, and the Perl and Ruby scripts can connect to this legacy database with no problem. I\'m trying to determine if I\'m doing something wrong (relatively new to Go) or not. In packets.go readResultOK(), the first time through it returns errOldPassword (data=[254]) as expected. Second time through it hits the default branch of the case statement, ultimately returning a \"Error 1045: Access denied for user\" back to the calling script. I\'m going to see if I can get the DBA to set \"old_passwords\" to OFF, but am still curious if I\'m missing something. ', 43);
INSERT INTO `topics` VALUES (11, 'go-sql-driver/mysql', 'When to open and close the connection', 'With this driver, is it best practice to every HTTP request open the database using Open(\"mysql\",\"...\") and close it using Close() at the end of every requst cycle or just open it once and never close it irrespective of the request cycle?', 40);
INSERT INTO `topics` VALUES (12, 'go-sql-driver/mysql', 'EOF error in packets.go readPacket() not propagating', 'I\'m running a query that is returning around 250k rows from a MySQL 5.1 server. Occasionally I will get incomplete result sets without an error being returned to my invocation of the API methods. It looks like readBinaryRow is not actually returning the non-nil error, and instead returning early with a nil error. This bug is particularly insidious because it is happening in a call to .Next(), which means that callers will be operating on partial result sets without knowing it. This happens with both an SSH port forward and when on a proper network connection (rackspace cloud).', 38);
INSERT INTO `topics` VALUES (13, 'go-sql-driver/mysql', ' unexpected EOF followed by packets.go', 'MySQL SELECT queries fail unexpectedly at random times in a long running CLI script. I can\'t really provide a sample code, but I can tell you that I only do simple SELECTqueries in my CLI program. I don\'t do any transactions, nor any UPDATEs. All the MySQL operations in my program are read-only (just a lot of SELECTs only). My program is doing just ONE query at a time, it runs on a single core virtual machine ($5 DigitalOcean Droplet) with only one go routine running at a time. I do not run out of RAM, I checked that, the swap file is only barely used on this virtual machine. So this problem is not new. I first noticed this issue this year. Sometime last fall I was using the exact same program on the exact same database, compiled by the then latest stable version of Go (probably Go 1.7), and at that time I never ran into this issue. So this must be something new, it must be related to some change(s) that occurred right around or before Go 1.8 got released. I noticed today that someone else also ran into this error pattern ( \"packets.go:66: unexpected EOF followwed by packets.go:412: busy buffer followed by driver: bad connection\" ) recently, please see his Edit#2 on this StackOverflow page. This is a showstopper bug for me. I might need to switch back to Go 1.7.x and recompile my program and see if that fixes this issue or not. Or do you have a better idea on how to debug this? BTW, my program is doing millions of SELECT queries and only a few of them fail. On every run different queries fail, it seems to me totally random.', 37);
INSERT INTO `topics` VALUES (14, 'go-sql-driver/mysql', 'Google Cloud SQL on App Engine - Connection String Outdated? ', 'No password was specified in the connection string because the documentation does not specify the need for a password. This post mentions that the connection password must be null when the app attempts to connect to the server using root@localhost.', 35);
INSERT INTO `topics` VALUES (15, 'go-sql-driver/mysql', 'packets.go:417: busy buffer, packets.go:436: busy buffer ', 'I got a http message to API, create another goroutine (and close a first one to let free http connection) and do something with message, try to get data from MySQL. All fine if I mak a tests with <100 messages and all bad if I got more then 100 messages per second. Output in the top. Ok just like a test I create new logic with separate DB connection for each incoming message, works better but expensive by connections resources... and one buffer error. Some part of messages was processed, some (with errors in output, no)... if we get first error in console any other Querys not work, if we try to use ping method before send - hi return nil... All errors handled by mysql golang driver and just printed with log. but not returned to upper level. So like a result impossible to detect error and establish new connection. And yes all fine if you have <100 requests and <100 DB querys. I have found issue (dated by 2015) about same problems in multi routines mode, but this absolutely not explained why we cant handle error on app level and why we still get :417 error in each 1 goroutine=1 DB connector mode. Any Ideas how to solve this? ', 33);
INSERT INTO `topics` VALUES (16, 'go-sql-driver/mysql', 'Connection Pool seems not to be used properly (any longer)', 'the connection pooling to the database server seems to be broken since golang version 1.13.1 or with the latest commit (14bb9c0). Running in version 1.12.9 and up to git commit 877a977 everything seemed to work. I have two servers, running each GO applications, that held two different connection pools to the same database-server - one connection is heavily used (DB1 with 20 Requests per second) and one is rarely used (DB2 with 1 Request per Minute). Server1 runs since round about 5-10 minutes. Server 2 runs since round about 3 days. Broken means that a part of the connections is no longer used and seems to be stale. I am a little bit confused about those two conenctions at the end. While on the other server go runs the old version and commit. The point why I\'ve been paying attention to this is that all of my connections from server1 got stale after about 38 hours of running. The Connections were not interrupted (all 50 connections were stale) and new connections (i\'ve started another instance of the same application) were able to create new connections to the database server. Maybe you have an idea how to debug such a situation. All of the databases requests look like this, while the initial connection is only initiated once and then the pool is used. ', 29);
INSERT INTO `topics` VALUES (17, 'go-sql-driver/mysql', '\"LOAD DATA LOCAL INFILE\" is much slower than mysql command line', 'In my test, I am trying to transfer 149MB files (each small file is about 3MB). INSERT INTO `topics` VALUES (18, 'go-sql-driver/mysql', 'driver: bad connection on query with MySQL 5.7... works fine on 5.6', 'I haven\'t been able to get a particular style of query to work on MySQL 5.7, but it works fine against MySQL 5.6 on the same hardware. 100% failure rate in Go right now. — Crashes the connection or something with driver: bad connection every time... and it stays like that for a few requests thereafter.', 27);
INSERT INTO `topics` VALUES (19, 'go-sql-driver/mysql', 'Google App Engine and External Database', 'I solved how to connect to an external database using Google App Engine (Standard Environment). The new issue is: In order to connect externally, I need to use socket API which requires a request to create the Google Context. This leads me to believe that we can\'t allow this driver to use connection pooling due to a new request requiring a new context. Am I correct in this assumption? If we can\'t use connection pooling, what\'s the best way to manage it? Is there a setting to disable connection pooling (i.e. max connection 1, 0 second idle time etc) OR create a connection at start of request cycle and close it and end of request cycle. The documentation says DO NOT CLOSE connection. Is this a good exception to the directive?', 27);
INSERT INTO `topics` VALUES (20, 'go-sql-driver/mysql', 'golang version 1.6.2 invalid connection', 'If you have an error log, please paste it here. If you have an error log, please paste it here.', 26);
INSERT INTO `topics` VALUES (21, 'go-sql-driver/mysql', 'Strange error on killed connection', 'As far as I know, that error is actually sent across the network connection back to the client that got killed. Is this being masked in the driver or the database/sql, or is it not an error transmitted via the protocol as I think? Can we make it more clear what\'s happening, somehow?', 25);
INSERT INTO `topics` VALUES (22, 'go-sql-driver/mysql', 'Server timeouts broken since', 'After more than 2 years being blocked, PR #302 was merged just two weeks ago. It purportedly fixes issues were queries were being wrongly \"retried\" (i.e. being ran twice by the database/sql client even though the original query went through). To accomplish this, it reduces the number of places where the driver returns a driver.ErrBadConn error: it only returns this value when we\'re 100% sure that the database has not received the original query, as returning ErrBadConn forces the database/sql client to retry the query altogether with a different connection, hence leading to redundant/repeated queries. In practice, however, this breaks the driver in any situation where the MySQL server can kill connections on the server side. Let\'s analyse why and try to find a workaround for this issue. We\'re gonna make the driver crash with a pretty simple reproduction recipe. First, we need a MySQL server configured to timeout idle connections. We\'re gonna use MySQL 5.7 and simply set global wait_timeout=3;. This will make mysqld kill any connections that haven\'t been active (i.e. sending queries) for 3 seconds. This whole example also works with any maintained MySQL release, including 5.6, and all MariaDB releases. The 3 second timeout is a bit aggressive but it\'s something similar to what we run in our main MySQL cluster here at GitHub. With this MySQL server in place, we can reproduce the issue with a few lines of Go code, using the master branch of go-sql-driver/mysql. It is clear that this is not the right behaviour. The mysqld instance is still up throughout the test, so even if the initial connection got killed by the server, calling db.Begin() should create a new connection instead of returning an error. This was the behaviour before #302 was merged. So, what\'s the underlying issue here, and why is database/sql not retrying the connection after the changes in #302?  The changes in #302 are sensible and appear correct when reviewed. The \"most important\" modification happens in packets.go, in the code to handle writes. The PR adds line 140, where if n == 0 && pktLen == len(data)-4 is checked. The rationale is as follows: Any interaction (i.e. query, exec) from the driver to the MySQL server happens in two phases: First, we write the packet with the query/exec command to the socket connected to the server. If this write succeeds, it means the server must write back an \"answer\" packet, so we immediately read the response from the socket. If this write doesn\'t succeed, it means the connection has gone bad (maybe the server killed it?), but we know for sure the server has not received our query, so we can return errBadConnNoWrite, which will get translated down the driver into driver.ErrBadConn and force database/sql to retry the query with another connection. However: If the write succeeds but the follow-up read from the socket fails (i.e. we never receive the \"answer packet\" from MySQL), we cannot return ErrBadConn, because the server has received our query and may have executed it even though we received no answer. We cannot let database/sql retry this query. This is perfectly sensible, but the previous reproduction recipe shows it doesn\'t work in practice. In our code, the following sequence of actions happens:We connect to the MySQL server. sql.Open. We ping the MySQL server by sending a \"ping\" packet. We receive a \"pong\" packet response from MySQL -- db.Ping returns successfully. We sleep for 5 seconds. After just 3 seconds, the MySQL server is going to kill our driver\'s only open connection. We wake up from sleep and attempt to begin a transaction, by execing a START TRANSACTION. We write an exec packet to the server with START TRANSACTION. The write succeeds. We then read the response packet from MySQL: This read fails, because MySQL killed our connection -- but now the driver cannot return ErrBadConn to retry this operation, because our initial write succeeded! The server may have executed START TRANSACTION! So the driver\'s only option is to hard crash. When written like this, the problem becomes really clear. #302 made an assumption about the TCP protocol that doesn\'t hold in practice: that after MySQL server has killed our connection, trying to write a packet from the driver to the server will return an error. That\'s not how TCP works: let us prove it by looking at some packet captures. This are steps 1 through 8 seen through Wireshark. The beginning is straightforward. We open the connection with a TCP handshake, we send a ping packet and we get a reply back (you can actually see two pings + two replies in that capture). We then go to sleep. And just 3 seconds later, in frame 14, the MySQL server enacts the timeout we\'ve configured. Our TCP connection gets closed on the server side and we receive a [FIN, ACK] pair... To which our Golang client simply responds with an ACK! There\'s no FIN response from the driver because we haven\'t closed our side of the connection, as we\'re sleeping. Seven seconds later, at T+10 (frame 18), we wake up from our sleep and attempt to exec a START TRANSACTION. And (here\'s what throws us off), the Linux kernel accepts the write just fine. It returns no error to Golang, because this is how TCP works. TCP is a bidirectional protocol, and our side of the connection is still open, so the write goes through. Of course, the MySQL server immediately replies -- with a RST. \"Dude, this connection is over\". But it\'s too late for our driver: the write of the exec packet already succeeded, and with this new logic, we assume that the query may have been executed by the server (even though the MySQL server was not even listening on our socket anymore). And meanwhile, the kernel has received the RST packet from the MySQL server. The next time we attempt to read from our connection, we will definitely crash. But with this new logic, a retry won\'t be attempted! This is bad news, because our original exec was not even close to making it to the server -- let alone being executed. There is, in theory, a \"right way\" to handle this general case of the server closing a connection on us: performing a zero-size read from the socket right before we attempt to write our query packet should let us know about that FIN packet we\'ve received: \"MySQL has closed this connection, buddy. Your side is open, so you can still write, and the kernel will swallow it... But it\'s pointless because MySQL isn\'t reading anymore and -- even if it were --, the FIN means it wouldn\'t be able to reply”. Here\'s the issue: the \"zero read\" semantics from Golang are a bit fuzzy right now. This commit from bradfitz special-cases this situation so the read never makes it to the kernel; before that, the read would always return io.EOF. This closed issue in golang/go has a very similar analysis to this one (at the TCP level -- not really related to MySQL), with several Golang core devs chiming in. I hope this in-depth analysis wasn\'t too boring, and I also hope it serves as definitive proof that the concerns that some people (@xaprb, @julienschmidt) had on the original PR are indeed very real: we tried rolling out the master branch of this driver in one of our Golang services and it\'s unusable with any of our MySQL clusters here at GitHub. As for a conclusive fix: I honestly have no idea. I would start by reverting the PR; I think the risk of duplicated queries is worrisome, but the driver as it is right now is unusable for large MySQL clusters that run tight on connections and do pruning. Doing a Ping before attempting new queries on connections that could be \"stale\" seems like a feasible workaround. But how do we mark such connections as stale? What\'s the timeframe? Should we let the users configure it? What\'s the overhead going to be like? I would love to hear from the maintainers on approaches to fix this. I have time and obviously interest on using the master branch of this driver in production and I\'ll gladly write & PR any fix for this issue that you deem acceptable.', 24);
INSERT INTO `topics` VALUES (23, 'go-sql-driver/mysql', 'packets.go:336: Busy buffer. Commands out of sync. Did you run multiple statements at once', 'I am trying to build a web server using this package and when i try to log hits into database too quickly i get the error: packets.go:336: Busy buffer. Commands out of sync. Did you run multiple statements at once? My code works fine untill i make too many requests too quickly... Whats going on here?', 24);
INSERT INTO `topics` VALUES (24, 'go-sql-driver/mysql', 'packets.go:36: unexpected EOF (Invalid Connection)', 'Got a long time running query, and go routine exit, but executed show processlist; in mysql presented that the query was still running. I have seted db.SetMaxIdleConns(0) and db.SetConnMaxLifetime(1000000000000), but that not works.', 23);
INSERT INTO `topics` VALUES (25, 'go-sql-driver/mysql', 'autoreconnection fails with prepared statements', 'From I could see, this driver doesn\'t support autoreconnection. Did I miss something? I know that mymysql supports this feature, but I\'d prefer to stick to your driver if possible.', 23);
INSERT INTO `topics` VALUES (26, 'go-sql-driver/mysql', '*sql.DB invalid memory address or nil pointer dereference', '\"stmt, err := dbpool.DB.Prepare\" is Error invalid memory address or nil pointer dereference', 22);
INSERT INTO `topics` VALUES (27, 'go-sql-driver/mysql', 'mysql5.7 unknown auth plugin', 'Tell us what should happen and what happens instead mysql5.7 unknown auth plugin.', 21);
INSERT INTO `topics` VALUES (28, 'go-sql-driver/mysql', 'runtime error: slice bounds out of range in packets.go ', 'When using many concurrent SQL queries (same pool), I get a slice out of bounds error. The corresponding logic in jmoiron/sqlx seems fine. It\'s just a call to (*Rows).Next() which is causing this.', 21);
INSERT INTO `topics` VALUES (29, 'go-sql-driver/mysql', 'Add Scan() support for time.Time', 'This is Issue 9 moved from a Google Code project. Please review that bug for more context and additional comments, but update this bug. Original labels: Type-Enhancement, Priority-Medium\n', 21);
INSERT INTO `topics` VALUES (30, 'go-sql-driver/mysql', 'Doesn\'t use database from DSN if tls=true ', 'Using tls=true in the DSN causes the db name in the DSN to be ignored when queries are executed. Edit: I modified the example to verify that no error occurs, and fixed to use NullString to handle null return value. I\'ve added an all-access test user to my MySQL server using. With TLS turned off, this produces, as expected. With TLS turned on, this produces, which is unexpected. In the latter case, I\'d expect DATABASE() = mydb. I can manually run a USE test; statement from my sample program, but it defeats the purpose of specifying the db name in the DSN, and in a real app, I\'d have to run that prior to every statement to ensure newly created connections also use this db name.\n', 20);
INSERT INTO `topics` VALUES (31, 'go-sql-driver/mysql', 'revel: Too much overhead for SELECT queries ', 'I observe some strange timing. When I execute time from Go using go-sql-driver, I am getting Query time: 216.405741ms QueryText I get this time following way: tinit := time.Now() rows, err := db.Query(querySQL1) Log(\"Query1 time: \", time.Since(tinit), querySQL1) At the same time I am taking times from mysql slow-log, and for the same query I see: Query_time: 0.000368. That is 0.3ms. Is there an explanation why it takes 216ms in go-sql-driver/mysql ?', 20);
INSERT INTO `topics` VALUES (32, 'go-sql-driver/mysql', 'Can\'t Connect to Any MySQL Server', 'I downloaded the most recent version of the MySQL driver and I cannot get it to connect to any databases. I\'ve tried using a DSN for both socket and tcp connections.', 20);
INSERT INTO `topics` VALUES (33, 'go-sql-driver/mysql', 'expect deadlock for select for update', 'We expect deadlock error for the below two transactions. But we didn\'t get deadlock error and got wrong result. (It works well via MySQL command line. And I also tried other driver like Python Django ORM.)\nReproduce for MySQL 5.5 and MySQL 8.0.', 19);
INSERT INTO `topics` VALUES (34, 'go-sql-driver/mysql', 'Weird behaviour with query cancellation using context', 'We are encountering weird behaviour. When we run slowInsert( 10 ) on a mysql client (eg. sequel pro), the 10 second wait is respected before insertion. We have no reason to believe that the stored proc is wrong or invalid. When we run the Go code above, the context is cancelling after 3 seconds -- all good. INSERT INTO `topics` VALUES (35, 'go-sql-driver/mysql', 'Add support for godoc.org/cloud.google.com/go/civil', 'It would be good if this package could automatically scan to civil.Time time data Date data type', 19);
INSERT INTO `topics` VALUES (36, 'go-sql-driver/mysql', 'Transaction Level ', 'I was wondering what the best way was to set the transaction level and have it revert back to default after the transaction - particularly in case of a panic', 19);
INSERT INTO `topics` VALUES (37, 'go-sql-driver/mysql', 'Client hung after end of results during heavy load ', 'I\'m running many concurrent transactions (half read, half write, often with statements which cause large write locks on rows/index pages) with tx_isolation=serializable, and rerunning transactions where any statement returns a *MySQLError with Number == ER_LOCK_DEADLOCK (1213). There are very often deadlock errors (~0.015 retries per completed transaction), which is expected under the kind of queries and load I\'m putting on the system. This code runs fine for a while, but occasionally (more often in heavy load), a client connection will get locked up waiting for an extra packet at the end of a result list that the server doesn\'t think needs to be sent. Unfortunately, this happens a hell of a lot under heavy load (once every couple of minutes at 100 transactions per second sustained.) The client is blocked (forever) on. It\'s not specific to the scheduler transactions either; it appears to happen randomly, roughly in proportion to what I expect the number of rows locked in each transaction is. I suspect either the mysqld implementation or the go mysql driver have a bug somewhere in their protocol handling, but I don\'t know where to go from here. Using go-sql-driver/mysql as of 9543750 Merge pull request #280 from hyandell/master. I can make this happen reliably with MySQL 5.5.37 and 10.0.14-MariaDB, and with Go 1.2.2 and Go 1.3.3, and have not found a version of anything on which it does not lock up.', 19);
INSERT INTO `topics` VALUES (38, 'jquery/jquery', 'Add support for passive event listeners', 'Blink has shipped support for EventListenerOptions and we expect to soon ship support for the passive option. Ideally jquery users would be able to mark event listeners as passive, so they can get the same performance benefits. Also @scottgonzalez mentions it would be good for jquery to polyfill the capturing API as well. Thoughts? Feel free to file any issues / questions with the spec here.', 65);
INSERT INTO `topics` VALUES (39, 'jquery/jquery', 'ESM distribution / exports in package.json', 'With your ESM work on source, will you provide an ESM distribution file as well? An ESM distribution can be handy for (ESM-based) projects that don\'t have a compilation step but which wish to avoid polluting HTML with their dependencies (i.e., by using import jquery from \'./node_modules/jquery/dist/jquery-esm.js\'; or such). And can you point to a non-bundled entry point with module exports in package.json so bundlers like Rollup can discover it, so that import jquery from \'jquery\' will work for such projects out of the box, e.g., without need for adding additional Rollup plugins or having to dig through source to find the entry point?', 34);
INSERT INTO `topics` VALUES (40, 'jquery/jquery', 'Run the Promises/A+ test suite in real browsers', 'We\'re currently running the Promises/A+ tests only in Node and only on master. That mean compat is mostly untested and on master we don\'t know if it really works in all the browsers. We should get the test suite run in real browsers. IE8 will be a problem since the suite uses getters heavily but even getting it all run in other browsers would be a huge win. It\'s not a must-have for the beta IMO but we should have it ready before 3.0.0 final so I\'ll set the milestone.\n', 31);
INSERT INTO `topics` VALUES (41, 'jquery/jquery', '<script defer> fires after $(function) in Chrome and FX', 'In Chrome, FX and IE >=10 <script defer> should cause scripts to be background loaded, but then executed in order before DOMContentLoaded fires. However, when lots of scripts are loaded with defer applied the jQuery event fires before all the scripts have run. Both tests pass when files load fast enough, but sufficient delays (>50ms each) in the *.js files cause the jQuery test to fail in latest Chrome and FX. It doesn\'t fail consistently, but the jQuery ready always fires before the document one. Here is a jsBin that reproduces it on first load, although this might depend on your network and subsequent loads won\'t show the bug. Try throttling your connection and CTRL+F5 if it doesn\'t happen on first load. This bug is extant in the latest 2.x and 3.x but doesn\'t seem to occur in 1.x. When debugging it appears that document.readyState === \'interactive\' and !document.documentElement.doScroll is true, so jQuery.ready fires with the minimum delay (4ms). Breaking on window.setTimeout halts execution while some of the numbered js files are still pending in the Network tab. I don\'t know whether this is a recent change in behavior, but Chrome and Firefox appear to report document.readyState === \'interactive\' as soon as the body is present, but before deferred scripts are evaluated. This isn\'t a problem in IE < 10 as it doesn\'t support defer (it sort of does, but fires scripts out of order and so would fail this test anyway).', 26);
INSERT INTO `topics` VALUES (42, 'jquery/jquery', 'Figure out how to tag jQuery Compat releases', 'Now that version numbers will match 3.0.0 will not suffice.', 60);
INSERT INTO `topics` VALUES (43, 'jquery/jquery', 'Different results of width() and height() since jQuery 3.0', 'I have a CSS transform:scale(2) in a root element with a div which has css width 200px. jQuery 2.x returns 200 for .width() as it uses offsetWidth. jQuery 3.0 returns 400 for .width() as it uses getBoundingClientRect(). This is a breaking change which should be at least mentioned in the upgrade guide.', 55);
INSERT INTO `topics` VALUES (44, 'jquery/jquery', 'Issue using JQuery 3.1.1 and CSP', 'I\'m using JQuery version 3.1.1 and I\'m trying to implement Content Security Policy directives on my webpage. I\'m getting the following error: INSERT INTO `topics` VALUES (45, 'jquery/jquery', 'Show more stopped working for display', 'Changing jquery-git2 to jquery-2.1.1 fixes the issue. This is a regression.\n\n', 51);
INSERT INTO `topics` VALUES (46, 'jquery/jquery', '1.12.0 vs 1.11.2 selectors with # broken', 'The following is a perfectly valid selector under 1.11.2: $(\'.class a[href=#anchor]’); But fails under 1.12.0, and requires quotes: INSERT INTO `topics` VALUES (47, 'jquery/jquery', 'Breaking change to the data module in 3.5.0 ', 'The change to the data module made here. Breaks projects that depend on hasOwnProperty() function availability. Many other project can be affected as well. Such change should not be introduced as a minor version upgrade.', 44);
INSERT INTO `topics` VALUES (48, 'jquery/jquery', 'Changes to offset break jQuery UI', '1617479 contains several breaking changes for jQuery UI. The first is the switch to return undefined for hidden or disconnected elements which has broken all of our interactions tests. The second is to allow offest to throw getBoundingRect not a function when offset is called on the window. While i agree this is probably not a valid use to begin with this may break a lot of other code expecting undefined.', 43);
INSERT INTO `topics` VALUES (49, 'jquery/jquery', 'Deprecate event shorthand methods', 'As discussed in the core meeting, we should deprecate on/trigger event shorthand methods in a pre-4.0 minor release. EDIT by @mgol: I fixed the meeting link, it used to point to the latest day on IR', 39);
INSERT INTO `topics` VALUES (50, 'jquery/jquery', 'Inadequate/dangerous jQuery behavior for 3rd party text/javascript responses ', 'Every text/javascript response gets executed. Even if we made a request to another service. CORS was created exactly to prevent this kind of behavior in JSONP (arbitrary code execution). So when we do or like in Rails\' jquery_ujs a form is being sent automatically, the attacker can respond us with text/javascript and execute arbitrary code on our origin. The fix is to not execute responses from 3rd party origins by default and make it an option. Don\'t know who to cc to discuss it. P.S. I would switch it off for same origin either, because using subtle redirect_to saving tricks we can redirect user to local JSONP endpoint and still get an XSS but those are much more sophisticated vectors.C.', 39);
INSERT INTO `topics` VALUES (51, 'jquery/jquery', 'Have $(window).outerWidth() include the scrollbar width ', 'It is sometimes annoying that (window).outerWidth() do not include the scrollbar width in their value. Especially when trying to match the window width to the CSS media queries. When the red background is actually applied to the document by the browser, jQuery tells the window width is less than 1600px (1600 - scrollbar width). This is annoying e.g. in cases where there are some mobile-specific stuff that needs to be done in both, CSS and JS. And they would need to be done at the exactly same width of the document/window. Fixing this would greatly help making consistent code with the CSS media queries.', 38);
INSERT INTO `topics` VALUES (52, 'jquery/jquery', 'Improve API interoperability with standard Promise', 'Discussed this at the jQuery team meeting in Amsterdam: The spec is still changing a lot (within whatwg and draft pages on github), so we\'ll wait for it to ship, unprefixed, not behind a flag, in stable browsers first. Once that happened, we should change/fix our implementation to match the spec (and shipped implementation). Can use .pipe() to continue using any jQuery-specific functionality.', 38);
INSERT INTO `topics` VALUES (53, 'jquery/jquery', '$.each fails intermittently on iOS due to Safari bug', 'There is a timing bug in iOS8 that causes mobile Safari to incorrectly report a \'length\' on objects that don\'t have one. To the best of my knowledge, this happens on iOS8+, possibly only on 64-bit systems. The bug is triggered for objects that have only numeric properties. In this case, if you query foo.length then mobile Safari will sometimes return 4 (the highest property + 1). This causes functions like $.each() to treat objects such as foo above as arrays instead of objects, and when it tries to iterate them as such it fails since there is no foo[0]. The latter check is immune to the iOS bug. I realize this is a fix just for one browser, but it\'s a browser with a very large user base. You can see more background and some repro steps at the following Stack Overflow discussion.', 37);
INSERT INTO `topics` VALUES (54, 'jquery/jquery', 'Download builder', 'Let\'s make one so people can\'t complain it\'s hard.', 35);
INSERT INTO `topics` VALUES (55, 'jquery/jquery', 'Reduce Android 2.3 support on master (was: Investigate Android 2.3 support) ', 'The hard truth is we\'ve never fully supported Android 2.3. First of all, our unit tests don\'t pass there in a couple of modules. There are serious AJAX issues with error handling: #1786, #2458 (#2458 seems pretty serious, see #2458 (comment)), there are manipulation issues with checked radios: #1785. Even though most of the tests pass, we cheat a little by putting Android 2.3 in special paths in some of them. There are various problems that happen only on Android 2.3, e.g. now it turns out it doesn\'t allow unquoted reserved words as property names, exactly as our favorite IE8: #2478. It happens quite often that something just doesn\'t work, e.g. currently for some reason AJAX tests hang very near the beginning. Surprisingly, it works on compat. Lots of hours are being constantly put into making this browser work with our tests. When we released the last stable version of jQuery, 2.1 (I\'m omitting patches) a year and a half ago, Android 2.3 still had a very large market share. Currently Google stats show it at 5.6% of all Android versions (this is not a mobile market share but Android market share). Real percentage might be a little higher as it\'s counted via Google Play Store but it\'s still not that large as it was back then. Cutting Android 2.3 support (see an experimental branch that does it) saves 186 bytes gzipped, most of which are the reliableMarginRight support test and a workaround. Making all tests pass would add more. There are a couple ways to solve the problem. Don’t change anything, try to make Android 2.3 finally pass & continue to suffer. Drop support from master but keep it on compat; still suffer, although a little less (for some reason Android 2.3 problems happen more often on master than compat). Support Android 2.3 only partially - ensure it parses jQuery correctly, run a few basic tests ensuring most important APIs work on most common inputs. Don\'t care for perfect compliance: less suffering but such smoke testing may not be effective; also, it\'s hard to draw the line what\'s important and what\'s not. Drop support from both branches, redirect people still needing support to the 1.x & 2.x jQuery lines.\n', 34);
INSERT INTO `topics` VALUES (56, 'jquery/jquery', 'Issues using ShadowDom and ShadowRoot elements', 'JSBin link to reproduce. Try in Chrome (or Firefox with dom.webcomponents.enabled turned on)). An element that is in the shadow dom appears in some ways to not be contained in the document. .offset() assumes that if the element isn\'t contained in the document then it\'s disconnected and returns an offset of {top: 0, left: 0}. When .offset() checks to see if the element is disconnected it could try walking up the DOM not only by checking .parentNode as .contains() does but also by looking at .host, which is how one travels up from a shadow root into its containing element.', 33);
INSERT INTO `topics` VALUES (57, 'jquery/jquery', 'SVGElement.offsetParent will be removed in Chrome around April 2016', 'Google Chrome says: \'SVGElement.offsetParent\' is deprecated and will be removed in M50, around April 2016. This may have been on your radar already?... may also have implications over gh-1765', 32);
INSERT INTO `topics` VALUES (58, 'jquery/jquery', '.attr() getter doesn\'t accept some characters in Firefox ', 'The h1.attr(\'Ω\') part prints \"omega\" in Chrome but undefined in Firefox. The getAttribute part prints \"omega\" in both browsers. This has hit AngularJS, see angular/angular.js#13318 (comment) for more info.', 32);
INSERT INTO `topics` VALUES (59, 'jquery/jquery', 'Improve performance removal of events with namespaces ', 'This probably happens because of the recursion, it\'s still fast though, in absolute numbers that is, but i wonder if could do better? I\'m thinking if we could do something, it should not hurt the byte size, otherwise it too much of the edge case to do something drastic.', 32);
INSERT INTO `topics` VALUES (60, 'jquery/jquery', 'Selector :contains within :has seems broken on Chrome ', 'Using the following example, the console shows 1,1,1,1 on Safari (15.6.1) and Firefox (104.0.1), but 1,1,0,0 on Chrome (105.0.5195.52). I would expect the result to also be 1,1,1,1 on Chrome. Based on our usage in Selenium, I think the result actually was also 1,1,1,1 on previous versions of Chrome (≤ 104).', 31);
INSERT INTO `topics` VALUES (61, 'jquery/jquery', 'getScript requires \'unsafe-inline\' CSP rule', 'jQuery should be able to load scripts via $.getScript without causing unsafe-inline CSP violations. Look at the following test case: index.html. If you click on the Load script via jQuery button the following error is shown in the browser\'s console (Chrome in this case). On the other hand if you click on the Load script via script tag button then the script is loaded without issues and the text OK is shown in the console. Note: I am reporting this issue, because third-party libraries use $.getScript() and they consider this a jQuery issue (rightly) and won\'t fix this by their own because they expect the fix from jQuery. Using constructs which require unsafe-inline or unsafe-eval are generally not recommended and the security community considers them as bad practice. Google recommends the same in their Web Fundamentals guide. So I hope you will consider changing the current behavior for the sake of a safer web (taking into account how widespread your library is).\n', 29);
INSERT INTO `topics` VALUES (62, 'jquery/jquery', 'jQuery 3 - window load inside ready state will not be triggered ', 'In jQuery 3.0.0 I got the issue, that a window load callback inside a ready state gets not triggered anymore. I think this is because it\'s async since 3.0.0. But this is used in jQuery plugins, to be only executed after all page content is loaded. And this is often wraped in a ready state by users.\n\n', 28);
INSERT INTO `topics` VALUES (63, 'jquery/jquery', '\'setTimeout is not defined\' ReferenceError in CommonJS-like environment (Firefox SDK)', 'This is an unusual use-case of jQuery (2.1.3) - an SDK addon has no obvious window object, and no reason to manipulate the DOM (injected \'content scripts\' do this). In fact there is a \'hidden\' window, which means jQuery should be usable for things like Deferreds, etc. Here\'s the \'main\' index.js (the first three lines are the Firefox \'magic\' to get hold of the hidden window, and are not important). This throws a \'setTimeout is not defined\' ReferenceError while require()ing jQuery, with the following stack trace. There are other instances of this usage of setTimeout in jQuery.', 28);
INSERT INTO `topics` VALUES (64, 'jquery/jquery', 'textbox not responding to keyup event in IE11', 'I have a select element and a textbox element. The textbox is wired with a keyup event handler that checks if the input is numeric using a Regex and clears any non-numeric characters. The textbox is also wired to a focus event handler to check if the value of the select element is numeric and if it\'s not then blur the textbox. Basically, the functionality is to enter phone numbers. The problem is that in IE11, non-numeric characters go through whereas is Chrome and Firefox the non-numeric characters are deleted as expected. Not sure if it\'s a jQuery or an IE11 problem.', 28);
INSERT INTO `topics` VALUES (65, 'jquery/jquery', 'saved.shift is not a function', 'My app auto-upgraded to 3.4.0 from 3.3.1 and broke with this error: saved.shift is not a function. I’ll append the browser version in a comment shortly.', 27);
INSERT INTO `topics` VALUES (66, 'jquery/jquery', 'focus event ignores additional data when triggered ', 'Way too much code though. I was thinking that if the user passed data that we use the \"standard\" trigger path rather than native events. It passes the data at the expense of some non-standard event behavior, but I think people are probably misusing the event system most of the time when this happens.', 27);
INSERT INTO `topics` VALUES (67, 'jquery/jquery', 'CORS HTTP patch request is not working on IE10/11', 'This is really an edge case to reproduce. As you can see, it will error when I tested with virtual box VM from (can any one confirm this issue exists in native windows?). But if you open the link with Chrome/Firefox/Safari, it works like a charm. However, same code setup for jQuery 2 works fine across IE10/11/Chrome/Firefox/Safari. As I dug into the code, I found there\'s some differences in creating xhr object between 1.x and 2.x code. Because we\'re using patch method and it\'s absence in the regex, the statement will use the old window.ActiveXObject( \"Microsoft.XMLHTTP\" ) and maybe it doesn\'t support patch method?', 27);
INSERT INTO `topics` VALUES (68, 'jquery/jquery', 'License tags ', 'The jquery javascript files that users run should be tagged as free software so that people who want to run only free software on the web could do so. jQuery is free software might be free software but since it is not tagged as such you have to either allow all proprietary javascript as well or just not run jQuery. LibreJS is a project by GNU to make it possible for those who want to run only free software on their browsers to only allow files that are free software. The license file on jquery.org (and rest of the page for that matter) is completely unaccessible from Tor.', 26);
INSERT INTO `topics` VALUES (69, 'jquery/jquery', '2.2 Release progress ', 'Instead of porting bug fixes to 2.2-stable branch i decided to go with opposite way - reverting back-incompat commits. I tried more conventional approach at first (and another three too), but it proved (to me) to be ineffective. Since there was a lot more conflicts then with chosen approach which were prompted by the use of the new QUnit API and style fixes. Below, you find three lists, one of the reverted commits and one of the questionable commits that are in 2.2-stable and are back-compat, but might be inappropriate for this release. And also list of reverted commits which requires special attention. I would expect from reviewers to check those lists and current state of the branch, verifying that API doesn\'t include new features, don\'t break back-compat and done overall correctly. You might notice that i included new jQuery#htmlPrefilter but didn\'t jQuery.Deferred#catch. Why? Because i think it might be a good opportunity to test new methods in the wild (would require a documentation updates though), but not the ones that are related to module rewrites (like catch()). If this method would be found productive it could be applied to 1.x branch.\n', 26);
INSERT INTO `topics` VALUES (70, 'jquery/jquery', 'Restore previous show/hide behavior ', '', 26);
INSERT INTO `topics` VALUES (71, 'jquery/jquery', 'Modify ajaxConvert to return a promise/thenable.', 'The internal ajaxConvert function always returns synchronously. This makes it impossible to support new techniques such as async JSON.parse by defining custom converters. Ajax is already asynchronous. ajaxConvert is in an unreachable private scope. I propose that we modify ajaxConvert to return a promise/thenable. If this is considered beneficial, I\'ll have a patch up with tests this week.', 26);
INSERT INTO `topics` VALUES (72, 'jquery/jquery', 'console.warn for .hide() and other perf gotchas. ', 'There\'s a known performance issue with hide & friends that jQuery would like to fix. I\'ve seen browsers leverage console warning used to create positive change. For example Firefox warns of __proto__ use and this got Zepto to drop it. I think this same technique could be used to deliver a gentle one-off warning about hide\'s use, or the underlying issue, and recommend an upgrade path. I\'d like to flesh out this idea for browser dev tools here for easier collaboration.\n', 26);
INSERT INTO `topics` VALUES (73, 'jquery/jquery', 'offsetParent fails to recognize 3D transform context ', 'According to W3C spec (and browser behavior) using a 3D transformation creates a new rendering context similar to position:relative; jQuery however will not return this as the offset parent, it will return incorrectly the closest container with position:relative; The absolute positioned element is relative to the 3D transformed context, but reports the wrong offsetParent. This is crucial for third party libraries which use jQuery (like my library Semantic UI) which need to determine correct offsetParent when using 3D contexts.\n', 26);
INSERT INTO `topics` VALUES (74, 'jquery/jquery', 'width(), height(), etc. shouldn\'t round ', 'Right now we\'re rounding off the answers from width(), height(), etc. to the nearest pixel - this makes it hard to do good positioning of elements (especially for animations). For example if you have 3 items that are width 33% inside of a 100px element we\'re returning 33px for each element. Theoretically an animation method might be able to return a more interesting result if they know that there are extra fractional-numbers getting rounded off. I got a report on this directly from Mozilla but I agree with them that this particular change makes it hard to get to good numbers.', 25);
INSERT INTO `topics` VALUES (75, 'jquery/jquery', 'Have Trusted Types API built directly into the jQuery Core Files ', 'The latest version of jQuery V3.4.1 has 5 innerHTML() which are not sanitized by default. Does the jQuery team plan on addressing these DOM XSS things in the near future with regards to the new Trusted Types API see here', 24);
INSERT INTO `topics` VALUES (76, 'jquery/jquery', 'Deprecate jQuery.isArray ', 'Seems fulfilled with Array.isArray', 24);
INSERT INTO `topics` VALUES (77, 'jquery/jquery', ':target doesn\'t match elements on initial page load in Chrome and Firefox ', 'I\'m able to reproduce this issue in Firefox 41.0.2 and Chrome 46.0.2490.80 m. Basically, selecting $(\':target\') during initial page load to a url that contains a document fragment fails to select the targeted element. This is caused by document.querySelectorAll(\':target\') returning null before page load (and sometimes it returns null after page load). Sizzle pipes the selector through querySelectorAll, which produces incorrect results.\n', 24);
INSERT INTO `topics` VALUES (78, 'jquery/jquery', 'IE8 Selector Bug', 'There\'s a known issue with IE8 and HTML5, that when it clones/adds a non-standard element to the page, it adds a blank prefix to the tag (and includes the colon). Note: \"non-standard\" is not exactly correct, there are standard, less common elements that this also happens to. jQuery is not selecting those blank-prefixed elements when there\'s a multi-stage (combo) selector. It works with find() and using the tagname without the prefix, but not when using a selector pattern like $(\'<ancestor> <descendant>\');. Refer to the example below, for a clearer understanding. Affected Browsers: I only know this applies to IE8. I\'m doubtful that it applies to other versions of IE, but I\'m not able to test.\n', 24);
INSERT INTO `topics` VALUES (79, 'jquery/jquery', '$.each breaks on string', 'When calling $.each with jQuery 3.3.1 like so: $.each(“woohoo\"); It breaks with an error: Uncaught TypeError: Cannot use \'in\' operator to search for \'length\' in woohoo. I think it should do either one of two things: Loop through the string character by character. Output a more sensible error, something like \"incorrect parameter type string for jQuery.each”. Firefox and Chrome throw the error above. Edge throws a different error Invalid operand to \'in\': Object expected which means the same. Safari throws another different error TypeError: obj is not an Object. (evaluating \'\"length\" in obj\') which means the same again. I suspect this problem affects every browser. I was each-ing through an object that is expected to sit in a data attribute on an element. Somehow, because of undue circumstances let\'s say, that data attibute is no longer rendered by the server as valid json, and is therefor passed to my code as a string, throwing the error I describe here. Novice developers might ignore this error for too long, because it doesn\'t look like an error in their code. This is no excuse, but I do believe clear error messages, or expectable behaviour when doing this on purpose, helps everyone.', 23);
INSERT INTO `topics` VALUES (80, 'jquery/jquery', 'jQuery 3.0 still breaks sourceMaps', 'Traceback reformatting breaks source-maps, it is unreadable compared to browser built in tracebacks, and it cannot be folded closed like browser built in tracebacks. Tracebacks are an essential development tool. Breaking traceback is not an acceptable way to write libraries. Closing tickets pointing out that jQuery breaks tracebacks, does not fix tracebacks.', 23);
INSERT INTO `topics` VALUES (81, 'jquery/jquery', 'CommonJS: avoid a global with a custom window passed to the factory', 'In a CommonJS scenario these lines may result in one of 2 things: window & window.document exists => the exported thing is a jQuery using window, the global is not set. otherwise, when a custom implementation is passed to the factory: require( \"jquery\" )( window ) the noGlobal flag is not passed => global is created. I thought for a moment we might want to pass along the second parameter but IMO we should just set it to true in such a case without asking for anything. Then it\'s trivial to attach it to the window by ourselves if needed. The fact that we behave differently in CommonJS based on the initial setup worries me.', 23);
INSERT INTO `topics` VALUES (82, 'jquery/jquery', '.toggleClass( className, function )', 'How about to add new api for toggleClass where first argument is class name and second is function which should return boolean? I was surprised why this is not implemented yet? Almost all methods do accept second argument as function, but toggleClass not.', 23);
INSERT INTO `topics` VALUES (83, 'jquery/jquery', 'Add hook to cleanData to allow cleanup', 'Just as jQuery itself needs to know when an element is cleaned up, plug-in code (and perhaps application/page code) sometimes needs this notification as well. The TinyMCE jQuery plug-in, for instance, monkey-patches jQuery to hook into empty, remove, etc. so it can clean up after itself. I was just doing a plug-in where each instance needs to respond to window resize, and try as I might, I can\'t come up with a way to do it that won\'t leave handler(s) lying around if the programmer using it doesn\'t call my \"destroy\" method -- and let\'s face it, that\'s pretty easy to fail to do. Recommend adding a hook or event that plug-ins (and application/page code) can use, with the clearly-documented caveat that almost any other option should be used first because of the potential performance implications. The performance cost in the normal case (when no one has hooked the event) looks trivially small: Looking at cleanData in the current dev source, it looks like it comes down to one extra property test just after  line 742 in manipulation.js (that line number will rot), which is pretty cheap. A quick test on my 2.4GHz machine with Firefox on 10,000 elements, 5,000 of which had data.events and one of which had data.events.destroy, the average time to clear the container was 124-126ms both with and without the above. The cost when someone has actually hooked the event, of course, will be higher but largely irrelevant; if they\'ve hooked it, presumably they have a reason. This would, of course, be a somewhat unusual event. My off-the-cuff is that it wouldn\'t bubble, and couldn\'t be cancelled. But there are other unusual events.', 23);
INSERT INTO `topics` VALUES (84, 'jquery/jquery', 'Safari detected as IE < 8', 'In case of body {zoom: 1.2} (or 1.1, 1.6) on Safari, get div.offsetWidth === 3, then body\'s zoom forcibly set 1 on this', 23);
INSERT INTO `topics` VALUES (85, 'jquery/jquery', '$.inArray(void 0, [\'foo\', \'bar\', void 0]) returns -1 (only in the real IE 8)', 'As mentioned in the title, this problem cannot be reproduced in newer version of IE using IE 8 compatibility mode, only in the real IE 8. The only other code we have running in the page is jQuery UI.', 22);
INSERT INTO `topics` VALUES (86, 'jquery/jquery', 'Be consistent when checking if the node is connected or not ', 'We usually tested it with jQuery.contains( elem.ownerDocument, elem ), but now we switching to elem.getClientRects()', 22);
INSERT INTO `topics` VALUES (87, 'jquery/jquery', ':visible/:hidden selectors unreliable', 'This issue is present in both version 1 and 2 of jQuery. It is happening on inline elements wrapping block elements, which is valid in HTML5, such as a header and an image wrapped in a single anchor. Different browsers report offsetWidth/Height of the anchor differently. For example Firefox would report one visible anchor in the example below, and Chrome will report 0. This also highly depends on the CSS styles applied, as on the page where this issue was discovered missing images are not displayed at all instead of the common missing image icon. While a browser may report an anchor as invisible, child elements are still visible and clickable as they inherit anchor properties. There are 2 potential solutions that come to mind, but each has flaws. Loop through child elements and check each for visibility. Potentially harmful for performance, although the selector is already marked as such in the documentation. Check parent for visibility. Probably not enough on its own, as it will report incorrectly, if anchor doesn\'t have visible children.', 22);
INSERT INTO `topics` VALUES (88, 'jquery/jquery', 'jQuery Class Operations on SVG DOM Attributes', 'First of all, jQuery is hugely helpful and the whole community thanks to you all. It\'s SO helpful, in fact, that spaces that it lacks end up being a huge pain for developers. Working with jQuery and detecting SVG hasClass, addClass, or any of the like on groups, path, or any other attributes is a huge pain. With the growing community and support for SVG, are there any plans in jQuery\'s roadmap to improve this workflow?', 22);
INSERT INTO `topics` VALUES (89, 'jquery/jquery', 'Performance: forced evaluation of camelCase(key) in $.fn.data()', 'When retrieving data from jQuery element with $element.data(key), jQuery needlessly calculates camel-cased version of key jQuery.camelCase( key ) even when data could be accessed via original key (or it is already camel-cased). This code could be rewritten in order to evaluate camel-cased key only when data_user.get( elem, key ) has failed or when user is setting the data.', 22);
INSERT INTO `topics` VALUES (90, 'jquery/jquery', 'Image preview not showing after cloning html form tag ', 'I have created a real time nested comment system using jQuery, Ajax, PHP, and MySQL. For each reply button, I have created a comment box with image preview and image upload. First, the data goes through Ajax from “index.php” to “comment_add.php” into MySQL. Second, the data is fetched from MySQL on “comment_fetch.php” and displayed by “index.php” through Ajax. Third, for the reply button, I cloned, using jQuery, a div tag containing the form tag to have the same comment box that is in the original message for each reply to a comment. However, apparently jQuery clone() method ignores some code. I have gotten the following problems. Image preview is not showing on reply button. However, when I hover the mouse pointer to where the image preview should be, I see the image name. After successful upload, the message “Comment Added” appears on “comment_add.php” page instead of “index.php” page. Here is the cloned div tag containing the form tag in index.php.', 21);
INSERT INTO `topics` VALUES (91, 'jquery/jquery', 'Make jQuery.when always async ', 'Making it a blocker at the moment for 3.0, can provide a pull for that. If there strong motivation to not deal with it, feel free to close.', 21);
INSERT INTO `topics` VALUES (92, 'jquery/jquery', 'The husky lint git hook is vulnerable to PATH changes', 'The linter git hook added in d94c453 has a significant fault; it creates a pre-commit file where PATH is hard-coded to the one at the end of initial npm install (subsequent npm installs don\'t update it). This poses a problem for tools like nvm where after removing an older Node version (e.g. when a new patch release comes out you might want to remove the older one to not keep vulnerable & outdated releases on the disk) the previous PATH stops being valid, the hook stops working and packages need to be re-installed.', 21);
INSERT INTO `topics` VALUES (93, 'jquery/jquery', 'Remove or document jQuery.fn.{push,sort,splice}', 'We should deprecate or document jQuery.fn.{push,sort,splice} as we do with most private stuff in 3.0.0. Currently those methods have a comment they\'re for internal use only. Summoning @paulirish & @fitzgen as I believe at least Chrome DevTools are using a presence of object.splice (or sth other from the list?) as an indicator that the object is array-like which makes jQuery objects display a little nicer than regular objects.', 21);
INSERT INTO `topics` VALUES (94, 'jquery/jquery', 'serialize() ignores input elements of type submit', 'Expected output: mensaje_id=2&texto=lalala&comentar=Comentar. Observed output: mensaje_id=2&texto=lalala serialize() should serialize the EXACT SAME DATA that would be sent by the browser if the form was sent normally. That includes input elements of type \"submit\", but jquery ignores them. I can\'t believe I\'m reporting this bug in 2015.', 21);
INSERT INTO `topics` VALUES (95, 'jquery/jquery', 'Single-member read methods should always return undefined for empty context ', 'Known offenders ($()[ method ]() currently returns null): scrollTop scrollLeft width height inner Widthinner Height outerWidth outerHeight', 21);
INSERT INTO `topics` VALUES (96, 'jquery/jquery', '$.parseHTML() creates anchor elements with empty href property in 1.12/2.2 in Chrome', '$.parseHTML() seems to be broken in jQuery v1.12.0 and later for Chrome INSERT INTO `topics` VALUES (97, 'jquery/jquery', 'find() with pseudo selectors behaves strangely in DOM', 'Take a look at the following example. In Firefox, look at the DIV within the developer tools inspector and then click on it. The attribute id=\"null\" gets added or, on a subsequent click, removed, however the css styling does not get applied. Closing and opening the dev tools again also removes the id. If you do the same in Chrome and its dev tools, the DIV element just flashes, indicating some sort of change. No id gets set however. IE seems to do nothing. Good. This seems to happen when there is no id for the element set and whenever a pseudo selector is being used. Might also not just be restricted to the find method.', 20);
INSERT INTO `topics` VALUES (98, 'jquery/jquery', 'Run jQuery unit tests in XHTML', 'We need to run the unit tests with an XHTML doctype to ensure that everything passes. ', 20);
INSERT INTO `topics` VALUES (99, 'square/picasso', 'Is support for VectorDrawables (API 21)?', 'Is support for the new VectorDrawable type introduced in Lollipop planned as a possible enhancement? Currently, when I attempt to load any VectorDrawable with Picasso. The ImageView blanks out and nothing is rendered.', 43);
INSERT INTO `topics` VALUES (100, 'square/picasso', 'Placeholder is stretched before updating the ImageView (2.2.0)', 'In version 2.2.0 the placeholder image is stretched right before being replaced with the actual image. It looks ugly. In previous version 2.1.1, this worked as expected. holder.photo is a SquaredImageView, meaning it has the same width and height. And the scaleType is \"centerCrop\"', 32);
INSERT INTO `topics` VALUES (101, 'square/picasso', 'Image returned from Intent.ACTION_GET_CONTENT is not correctly rotated', 'The images taken with my camera include exif data orientation 90. When ACTION_GET_CONTENT is used, as opposed to ACTION_PICK on KitKat, the new DocumentsActivity is shown to allow the user to choose an image. If an image is chosen from there, the image that picasso displays is not rotated correctly. You can very easily reproduce this with the following diff and running the sample app on a device with kitkat', 25);
INSERT INTO `topics` VALUES (102, 'square/picasso', 'Error 504 when get image', 'Couldn\'t get picture from pixabay.com.', 23);
INSERT INTO `topics` VALUES (103, 'square/picasso', 'Picasso suddenly stops displaying images which previously worked', 'Not sure if Picasso can do anything about it, but I believe I found a possible issue related to disk caching: Images that previously loaded fine suddenly stop working. Instead of the image, a black screen is displayed and the error image specified in .error() is NOT loaded. Restarting the app or the device doesn\'t clear the problem, but uninstall/reinstall does. After a reinstall images are loaded normally. Based on this, I figured it must be a disk caching problem, and most probably the cached images are defunct. So I want to tell you what I did and what might have caused this: I am loading a lot of large images into a scroll view, of which most are outside the viewport. So I played with removing images from imageViews that are currently not visible. I randomly applied the following code found here. It seems like Picasso still held a reference to the drawable at the same time and recycling the drawable destroyed it in the other thread, which rendered it defunct. But Picasso still believes it has a valid drawable cached and tries to reuse it the next time it is loaded. Possibly a simple check if a cached image is valid - and reverting to loading from memory or the network in case it is not - would fix the problem. I don\'t know if this is related, but Picasso suddenly stopped displaying certain images (which were most possibly cached on disk). After uninstall/reinstall it worked normally again.\n', 22);
INSERT INTO `topics` VALUES (104, 'square/picasso', 'Can\'t load images into widget\'s listview', 'I can\'t load images into every item of widget\'s ListView, it just breaks widget layout. I use RemoteViewsFactory to handle listview population.The same happens (but only sometimes) if I inflate and add to RemoteViews the same item layout in for-loop', 22);
INSERT INTO `topics` VALUES (105, 'square/picasso', 'Picasso does not load the image nor does it log', 'I am supplying picasso through Koin (DI). This OkHttp3 is a singleton used across every entity that requires it such as Retrofit, Picasso. I then load the image like this in a recycler view. I have logged the URL\'s and verified that the URL\'s are working. But I see no image in the imageView nor do I see any logs as I\'ve set logging interceptor to be true. I also tried commenting out the OkHttpDownloader instance in picasso so that I use the default configuration. But that doesn\'t work either.', 21);
INSERT INTO `topics` VALUES (106, 'square/picasso', 'Pluggable transition mechanism', 'I don\'t find it now, but I made a similar request a few months ago and you guys rejected it because you wanted to keep Picasso simple (a good thing, I agree; and my suggestion was not as clean as this one here). So let me bring this up again, please. Suggestion: Add a fade() method, which always fades in an image, no matter if it comes from memory or the network. Why is this useful? In image libraries, where many images are shown on the same screen, part of the images come from the network and part are in memory already, so the visual effect varies between images which is a no-go for any UI. Sure I can set .noFade() which makes the visuals the same no matter where the image comes from, but then the nice smooth fade-in is gone as well. Or I can control it manually, which I want to avoid and which is the reason why I am using Picasso. Also, it is not logical to be able to deviate from the default behavior in one direction, but not in the other. My suggestion can be implemented in a few lines of code and is fully backward compatible, so I am asking you to reconsider. I believe this change will add value to Picasso.', 21);
INSERT INTO `topics` VALUES (107, 'square/picasso', 'Should #placeholder(int) and #error(int) support theme attribute?', 'I mean in case we want some theme-depended drawable (vector, for example, which could be passed theme\'s color as attribute, not constant color value). By that a placeholder\'s drawable could be \"lighter\" in dark theme, and \"darker\" in light theme, dynamically. (IMO, caching a placeholder drawable is not necessary, as it doesn\'t consume too much resource). The problem now is: Picasso will use a final ApplicationContext for its #getDrawable() action, which will not listen to theme\'s attributes. Don\'t know if you are interested in theming and support libraries or not, but it would be nice if Picasso supports something like ContextCompat.getDrawable().', 20);
INSERT INTO `topics` VALUES (108, 'square/picasso', 'Out of Memory - Nexus 5 - Android 4.4', 'I\'m seeing a lot of these after moving through a FragmentStatePagerAdapter. Could there be a difference? I don\'t recall this in my Nexus 4 with JB 4.3. (Tho I will investigate). I\'m posting this as a reference to see if I\'m the only one. I am using code like this. And the \"target\" (mBackgroundImageLoader) is this. update() does a few things but the ImageView is mMixImageNormal.', 108);
INSERT INTO `topics` VALUES (109, 'square/picasso', 'Exception: java.io.IOException: Cannot reset', 'We are having an issue in an app, when in a listview, images on some rows load but some of them are blank. I tried to trace it and collect as much information as I can. By the way, I don\'t know if it matters but airplane mode is on, but wifi is connected. I added this because with every row loading, I am seeing this in logs. Also the app crashed with this, after scrolling through the list up and down many times. The app doesn\'t seem to crash and I also didn\'t see the W/Settings airplane message if I switch to style instead of Picasso.Builder.', 72);
INSERT INTO `topics` VALUES (110, 'square/picasso', 'Won\'t load camera images', 'I am trying to use Picasso to load images in an app from the SD card. If I load images that were not taken by the camera they load in fine, but if I try to get images that were taken by the camera they don\'t load. Images over http work too, just not the camera ones. I have also tried downloading the image from that URL and putting it on the phones storage, it loads fine that way too, it only seems to be images taken from the phones camera. Tested it on Galaxy S2 and S5 and a Galaxy Ace 3. So it could be a Samsung/Galaxy issue only.', 54);
INSERT INTO `topics` VALUES (111, 'square/picasso', 'Image won\'t show (SkImageDecoder::Factory return null)', 'I\'m using Picasso to fetch user\'s twitter images, but there\'re some users whose image is not loading. I\'ve noticed that logcat prints this whenever it happens.', 44);
INSERT INTO `topics` VALUES (112, 'square/picasso', 'image not loading', 'i used the picasso sample app to test this by adding the url to the list in Data.java. this doesn\'t load', 41);
INSERT INTO `topics` VALUES (113, 'square/picasso', 'I get half photo and half white color, and sometimes I get only the white color.', 'I try to load photo in to girdview sometimes a few photos show only half photo and white color for other half, and some the photos show only white color just like the screenshot below.', 40);
INSERT INTO `topics` VALUES (114, 'square/picasso', 'Images no longer displayed after killing/updating the app', 'When I install my app on my device, everything works perfectly. But when I update it (like using the \"run\" button from Android Studio), or just kill it (by swiping it from my \"Recent apps\"), the images are no longer displayed. Looks like a cache issue to me. The URL is obviously working (locally) since it\'s working when I uninstall/reinstall the app. The image is not huge (58KB). It\'s also the only image I\'m trying to load so it\'s probably not a cache size issue. The code is inside getView() on a custom Adapter.', 40);
INSERT INTO `topics` VALUES (115, 'square/picasso', 'heavy performance issue', 'I experienced a strange behavior if I try to load a couple 480x320 jpg file into a 100dp x 100dp imageviews (5-6 max on the screen in portrait mode) in a gridview, it is lagging heavily except if it comes from the cache itself. However when i\'m trying to load much smaller pictures it is totally smooth. I\'m 99% sure that is related to the cache because if i\'m using the .skipMemoryCache() function it is much more better! This is happening on all device not just on my n5. The library usage is not overly complicated. Picasso.with(mContext).load(mModel.getImageLink()).into(mPreviewImage); There are 4 more textviews next to the image in the cell. If\'m not loading any images then it is totally okay. The overdraws are minimized everything is green and blue. The latest okhttp 1.5.4 is present. There could be 2000 elements in the adapter. I\'m using your awesome library from the beginning and never experienced such a performance drop.', 39);
INSERT INTO `topics` VALUES (116, 'square/picasso', 'Bitmap from camera not loaded - Moto G Android 5.0.1', 'As discussed in issue, I am encountering this problem again, since that issue is now closed I am opening a new one to report this bug: Picasso 2.5.2 fails to load images from the local Uri of an image captured via a Camera Intent (the manifest has all the required permission to work with STORAGE and DOCUMENTS). It doesn\'t throw any exception, the only trace I get of this error is when I attach a Target to the ImageView and it triggers the onBitmapFailed() method. I am using a Moto G on Android 5.0.1. NB: it may be useful to know that I don\'t get this error using Genymotion\'s emulator camera.', 37);
INSERT INTO `topics` VALUES (117, 'square/picasso', 'Declarative Cache Control API', 'I\'ve been sitting on this for a while as a future feature but hadn\'t documented it. The API would allow specifying a cache interaction policy both \"downward\" on the load and \"upward\" back through the processing. Through this you can facilitate complex cache interactions for both valid and seemingly-questionable use cases. Random subset of interactions from other issues. Skip memory cache \"downward\" only. Skip memory cache \"upward\" only. Load from local cache (memory or disk) only. Force re-load from network. I\'m not going to do a full-on API strawman, but I know we\'ll probably want some EnumSet action with. This API will trump the existing weak skipCache() method on RequestCreator.', 37);
INSERT INTO `topics` VALUES (118, 'square/picasso', 'Images at certain URLs do not load (was: Images that need to be resized up do not display at all)', 'I have two ImageViews; one is 218x192 and the other is 278x192. If I load the same 250x250 image into both of these views with resize([ImageView size]) and centerCrop(), the image is displayed in the first ImageView (which resizes the image down to 218) but not in the second ImageView (which would resize the image up to 278). Only the placeholder is displayed in the second ImageView. I believe this is a regression in 2.0.0 and the upsizing was working previously.', 35);
INSERT INTO `topics` VALUES (119, 'square/picasso', 'Unable to load images with no extension', 'Testing with Nexus 4 API19 on GenyMotion v2.2.2. When I try to load an image from. It returns the image in the browser with the following headers: Content-Type:image/png. I have tried attaching .png to the request URI but that doesn\'t seem to work either. When I try to load an image from another site with an extension it works fine. I\'m calling it from a listview adapter.', 33);
INSERT INTO `topics` VALUES (120, 'square/picasso', 'Picasso can\'t load these images from sdcard!', 'I think Picasso read these images recognition error!', 33);
INSERT INTO `topics` VALUES (121, 'square/picasso', 'Some images are not loaded when centerCrop and fit are used', 'This happens for this image', 33);
INSERT INTO `topics` VALUES (122, 'square/picasso', 'Webp image format not supported', 'I\'m working on grabing some \"webp\" images actually it has something to do with \"webp\" extension of image. the format now google is using not supported by picasso', 32);
INSERT INTO `topics` VALUES (123, 'square/picasso', 'Horrible performance when loading local files', 'First of all, fantastic job with this library. I really like the API. I\'ve been experiencing some rather annoying performance issues when loading local images on the device using Picasso. In short, it\'s causing major lag when scrolling and I\'m really not sure why it\'s happening. I\'m almost certain the problem isn\'t with my layout or code. It\'s working wonderfully without the Picasso call in my Adapter\'s getView(). It\'s worth mentioning that the library is NOT causing lag when loading images from the web - only with local content. Here\'s a screenshot from my application when loading images while scrolling (on a Nexus 10). As you can see, it\'s not pretty. This is using the standard Picasso.with(context).load(\"fileUrl\").into(ImageView) stuff. Like I said, if I load network images from the web, it\'s perfectly fine. The issue only occurs with local files. Is this a known issue? It occurs on all my devices - some worse than others. My Nexus 5 isn\'t affected as much, but both my Nexus 7 (2013) and Nexus 10 are suffering horribly from it. They\'re capable of displaying more images at once, so that might explain it. I\'ve encountered the issues using the latest release version (2.1.1) and on a snapshot from the current master branch.', 31);
INSERT INTO `topics` VALUES (124, 'square/picasso', 'Strict Mode Violations When Scrolling', 'Hitting the following stack trace when scrolling with StrictMode on. Here\'s the settings that I\'m using for StrictMode. Took at look at similar issues but didn\'t see any resemblance to the issue that I\'m hitting, especially since both of those issues look to be fixed and included in current versions.', 29);
INSERT INTO `topics` VALUES (125, 'square/picasso', 'Getting 504 Gateway Timeout from ResponseException', 'I\'m having an issue on some devices on the same network when downloading photos from Flickr. Following your suggestion on a previous issue, here is how I\'m calling Picasso. And here is the full stack trace of the exception I\'m getting. I tried playing with client.setConnectTimeout and client.setReadTimeout but they don\'t seem to influence the downloader at all. The crash always occur before any timeout I set. Any ideas?', 28);
INSERT INTO `topics` VALUES (126, 'square/picasso', 'Rotate if necessary', 'How can I rotate the picture automatically if the photo has been taken in a different orientation?', 27);
INSERT INTO `topics` VALUES (127, 'square/picasso', 'Picasso 2.0.0 seems not working in Android 2.3', 'I tested in three device , Android 4.2.1 and two Android 2.3 devices. 4.2.1 works well , however the others can not set image correctly in ListView Adapter. I changed to Picasso 1.1.1 , all work well.', 27);
INSERT INTO `topics` VALUES (128, 'square/picasso', 'Image download callback', 'Can I register a callback method on each into request so that I can do custom stuff after the image has downloaded? For eg: hide the progress bar, show custom notifications etc.', 27);
INSERT INTO `topics` VALUES (129, 'square/picasso', 'OutOfMemory error for error drawble', 'I get some crashes when loading an error drawable. Is resize() or centercrop() method not used for error/placeholder drawables?', 25);
INSERT INTO `topics` VALUES (130, 'square/picasso', 'Unusual cache behavior with 2.1.1', 'I\'m having a strange issue. Is resulting in images loading absolutely perfectly, or, erroring for absolutely no reason that I can discern. I have discovered that clearing the application cache makes the images load from URL just fine, and it will usually work fine for a few more application runs before resulting in failures. Every image will keep failing in the gridview until I clear the cache. Setting to debug didn\'t seem to result in anything useful, and it\'s not throwing any errors, so I really don\'t know what the issue is.', 25);
INSERT INTO `topics` VALUES (131, 'square/picasso', 'Picasso not loading images from https urls', 'I\'m running a simple test where I try to get a photo from Flickr like so. Problem is, if I use https, the loading fails with a timeout. It doesn\'t happen if I use http instead. Is there any config setting I could use or something else that can be done or that I am missing? Below is the stack trace.', 24);
INSERT INTO `topics` VALUES (132, 'square/picasso', 'Resize and fit don\'t properly resize when loading a local file (throws bitmap too large exception)', 'I attempt to use local files if they exist on the user\'s phone rather than fetching a remote image url. For panoramic photos, the file on the phone is something like 4500 x 500, huge images. If we fetch the image from the server, it is already scaled down so it comes back at a reasonable size of 640 x 200 or something. So if I try to load the phone file to fill the width of the screen. It throws the \"bitmap too large to be loaded into a texture\" exception with the 4500 width instead of the screenWidth (which is around 1050). Loading the same image from the server works great. I thought the whole point of resize() (also tried fit()) was supposed to take care of this issue but it doesn\'t seem to work properly when using local files, or am I not just incorrect about that? As a workaround I\'m planning to check the size of the local file and if it\'s too large just load from the server but this seems like an unnecessary step.', 24);
INSERT INTO `topics` VALUES (133, 'square/picasso', 'Picasso Not displaying images from disc cache', 'Downloading images and caching in memory is working. But there are no displayed image when I turn off internet connection. I expect that there should be displayed images from disc cache. Whole problem is described on stackoverflow.', 24);
INSERT INTO `topics` VALUES (134, 'square/picasso', 'PicassoDrawable cannot be cast to BitmapDrawable', 'onDraw() in my CustomImageView. Drawable drawable = getDrawable(); INSERT INTO `topics` VALUES (135, 'square/picasso', 'Using fit() on an ImageView with a WRAP_CONTENT dimension does nothing', 'This is closely related to #425 but I thought it was better to separate them as I wanted to discuss a solution thats specific to this. getMeasuredWidth() and getMeasuredHeight() will always be zero for a WRAP_CONTENT dimension. Meaning the query is deferred indefinitely. I\'m happy to make a pull request for this but I\'m unsure which route I should take. Options that I see include. Throw an exception for making such a request (fit() on an ImageView with a LayoutParam of WRAP_CONTENT). Forget about deferring the request because we\'re still \"fitting\" into a WRAP_CONTENT view, so I can just do a check and ignore the deferred, pulling the entire image into the View. This is user error and we should ignore it? It seems Add ability to fit image to a single dimension #365 might be an option as to how the user could work around it when they only have one dimension. But wouldn\'t work if both dimens are WRAP_CONTENT and it requires the user to know the API.', 22);
INSERT INTO `topics` VALUES (136, 'square/picasso', 'imageview shows same image', 'For some reason, imageview show 1 or 2 of 5 images in listview and others failed. But if scroll up and down listview some times, all imageview are made of 1 or 2 images. The reason image download failed seems because of dual wan.', 22);
INSERT INTO `topics` VALUES (137, 'square/picasso', 'Picasso leaks context even though cancel is called', 'I load my photo using. And I cancel this request in onStop() method using this line of code. Yet I get this log from leak canary.', 21);
INSERT INTO `topics` VALUES (138, 'square/picasso', 'Null validation and Empty validation in Picasso Image Path', 'It wired to observe that Picasso has not handled null and Empty url. If null is passed in Picasso.load() it never loads error Image which is required. If blank image passed in Picasso.load() app gets crashed gives Path must not be empty Exception happens. Developer need to add validation for both the cases.', 21);
INSERT INTO `topics` VALUES (139, 'square/picasso', 'Resource Leak detected by StrictMode', 'A resource was acquired at attached stack trace but never released. See java.io.Closeable for information on avoiding resource leaks.', 20);
INSERT INTO `topics` VALUES (140, 'square/picasso', 'Certain URLs failed to load image for no reasons', 'I\'m trying to load. It works in Chrome and all other known browsers (Including the Android default browser). But it doesn\'t load in Picasso. I\'ve tested the image URL in fiddlers web proxy with empty headers and the server was able to respond. ', 20);
INSERT INTO `topics` VALUES (141, 'square/picasso', 'Internet Permission problem', 'My application throws an IllegalStateException while in my manifest I have the permission correctly. It works perfectly in other versions; It\'s extremely rare.', 20);
INSERT INTO `topics` VALUES (142, 'square/picasso', 'How to pause any ongoing background work?', 'For example background work could be paused when a ListView or GridView is being scrolled using a AbsListView.OnScrollListener to keep scrolling smooth.', 20);
INSERT INTO `topics` VALUES (143, 'square/picasso', 'Resize with keep aspect ratio', 'I\'d like to be able to resize an image by keeping a ratio aspect. Right now it is \"complex\" to do with a new Target and we are losing some great \"build in\" feature of Picasso.', 20);
